window.bookSummaryJSON = "<p>In this prequel to <i>Scratches</i>, the members of Third Squad are sent on a recon mission to Northern Vietnam in 1967. Their squad leader, Sgt. George Hanscott, has to make the difficult decision to disobey his unit's direct orders, putting his squad's lives at risk, or help a local fishing village end the terror that's been plaguing them for over a century. </p> <p>Will his decision backfire, or will his squad of US Marines be able to destroy the evil entity they don't quite understand? Will we find out how George became such a heinous monster? Do we really want to know?</p>"; 
